window.bookSummaryJSON = "<p><b>A set of ubernaturals, a demon-powered mage, and police chief who is far more than he seems.</b></p> <p><i>This Las Vegas Paranormal Police Department box set covers the Ian Dex Unleashed storyline, giving you 7 full novels! </i>&nbsp;</p> <p>Ian Dex is a genetically engineered man who has abilities from all classes in the supernatural spectrum. He's also the chief of the Las Vegas Paranormal Police Department (PPD). His job is to monitor all supers and their involvement in the world of normals.&nbsp;&nbsp;</p> <p>A group of ubernaturals has recently descended on the city, forcing Ian and his crew have to put everything on the line to control the ensuing chaos. While the crew of the Las Vegas PPD aren't exactly strangers when it comes to dealing with death, destruction, and mayhem, fighting these new powerful beasts is admittedly taking its toll.</p> <p>If they fail, it's highly unlikely that what happens in Vegas is going to stay there this time around...</p> <p><b>Book 1: The Merging</b></p> <p><b>Book 2: Grave Creatures</b></p> <p><b>Book 3: Blood Bane Tower</b></p> <p><b>Book 4: London Growl</b></p> <p><b>Book 6: Curse of Fangs</b></p> <p><b>Book 7: Clash of Flames</b></p> <p><i>If adult-language, dirty jokes, action, and snark—all wrapped around great storylines—are your thing, this is the series for you! The language is blunt, the snark is fierce, and the abundant innuendo seems to be an official requirement.</i></p>"; 
